(37, 0, '777', '0.00', 0, '', 3, '2016-01-27 19:13:16', '2016-01-27 19:17:24', 1, 0, 0, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'true_religion_logo.png', 0, 0, 0, 0.00, 0, 0, 0, '0.0000', 0, 0, 0, 1, 'True Religion', 'True Religion', '', '<p>True Religion</p>', '', '', '', '', '20850', 'Rockville', 'Maryland', '-77.168', '39.087'),
(38, 0, '0013', '0.00', 0, '', 5, '2016-02-24 09:32:16', '2016-02-24 12:00:36', 1, 0, 0, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'boulevardtavernlogo_high.png', 0, 0, 0, 0.00, 0, 0, 0, '0.0000', 0, 0, 0, 1, 'Boulevard Tavern', 'Boulevard Tavern', '', '<p class="MsoNormal"><b>Complimentary Crispy Calamari appetizer or Wings</b></p>\r\n<p class="MsoNormal">Chit chat while you savor your choice of a Crispy Calamari appetizer or Buffalo Style wings</p>\r\n<p class="MsoNormal">Courtesy of <i>Boulevard Tavern</i></p>\r\n<p class="MsoNormal">Timing: Sunday - Wednesday 4-7pm </p>\r\n<p class="MsoNormal">311 Kentlands Blvd. Gaithersburg, MD 20878</p>\r\n<p class="MsoNormal">Making a reservation would be nice: <a href="http://www.thetaverns.com">www.thetaverns.com</a> </p>', '', '', '', '', '20814', 'Bethesda', 'Maryland', '-77.1022', '39.0003'),
(39, 0, '0014', '0.00', 0, '', 5, '2016-02-24 09:38:23', '2016-02-24 09:42:17', 0, 0, 0, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'mussel_bar_big_logo.jpeg', 0, 0, 0, 0.00, 0, 0, 0, '0.0000', 0, 0, 0, 1, 'Mussel Bar Arlington', 'Mussel Bar Arlington', '', '<p class="MsoNormal"><b>Complimentary House cocktails or House draft brew – 21 years and older (Bar / Lounge Seating)</b></p>\r\n<p class="MsoNormal">Enjoy your choice of a house cocktail or draft beer and talk a bit.</p>\r\n<p class="MsoNormal">Courtesy of Mussel Bar Arlington: {Insert location}</p>\r\n<p class="MsoNormal">Timing: Monday through Thursday 4:30pm – 8:30pm</p>\r\n<p class="MsoNormal">Making a reservation would be nice: http://musselbar.com/locations/arlington/</p>', '', '', '', '', '22203', 'Arlington', 'Virginia', '-77.1142', '38.8738'),
(40, 0, '0015', '0.00', 0, '', 5, '2016-02-24 09:43:19', '2016-02-24 12:01:38', 1, 0, 0, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'brasserie_beck_logo_1500.png', 0, 0, 0, 0.00, 0, 0, 0, '0.0000', 0, 0, 0, 1, 'Brasserie Beck', 'Brasserie Beck', '', '<p class="MsoNormal"><b><i>Complimentary Cappuccinos or Coffee.</i></b>  </p>\r\n<p class="MsoNormal">Enjoy 2 complimentary coffees or cappuccinos <b>Saturday or Sunday</b> and talk a bit.</p>\r\n<p class="MsoNormal">Courtesy of <i>Brasserie Beck</i>. {Insert location}</p>\r\n<p class="MsoNormal">Timing: Saturday &amp; Sunday 11:30 – 5pm</p>\r\n<p class="MsoNormal">1101 K Street, NW Washington DC 20005 </p>\r\n<p class="MsoNormal">Making a reservation would be nice: <a href="http://brasseriebeck.com/washington-dc/contact/">http://brasseriebeck.com/washington-dc/contact/</a></p>', '', '', '', '', '20005', 'Washington', 'District of Columbia', '-77.0312', '38.9067'),
(41, 0, '0018', '0.00', 0, '', 5, '2016-02-24 09:45:47', '2016-02-24 12:05:53', 1, 0, 0, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'V___S.jpg', 0, 0, 0, 0.00, 0, 0, 0, '0.0000', 0, 0, 0, 1, 'Villain & Saint', 'Villain & Saint', '', '<p class="MsoNormal"><b>Complimentary Admission to a hosted show</b></p>\r\n<p class="MsoNormal">Groove to the sounds while you enjoy a night out with <strong>free admission</strong> to a Villain &amp; Saint live music event.</p>\r\n<p class="MsoNormal">Courtesy of <i>Villain and Saint</i>.</p>\r\n<p class="MsoNormal">Timing: Wednesday - Saturday 8-pm - Close</p>\r\n<p class="MsoNormal">7141 Wisconsin Ave, Bethesda MD 20814</p>\r\n<p class="MsoNormal">Make a reservation: www.villainandsaint.com</p>', '', '', '', '', '20814', 'Bethesda', 'Maryland', '-77.1022', '39.0003'),
(42, 0, '0016', '0.00', 0, '', 5, '2016-02-24 11:29:31', '2016-02-24 12:02:52', 1, 0, 0, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'River_Falls_Tavern.jpg', 0, 0, 0, 0.00, 0, 0, 0, '0.0000', 0, 0, 0, 1, 'River Falls Tavern', 'River Falls Tavern', '', '<p class="MsoNormal"><b><i>Complimentary Cappuccinos or Coffee.</i></b>  </p>\r\n<p class="MsoNormal">Get to know each other better while you enjoy 2 complimentary coffees or cappuccinos.</p>\r\n<p class="MsoNormal">Courtesy of <i>River Falls Tavern</i>. </p>\r\n<p class="MsoNormal">Timing: Saturday &amp; Sunday 11:30am – 5pm</p>\r\n<p class="MsoNormal">10128 River Road, Potomac MD 20854  </p>\r\n<p class="MsoNormal">Making a reservation would be nice: www.thetaverns.com</p>', '', '', '', '', '20854', 'Potomac', 'Maryland', '-77.1922', '39.0388'),
(43, 0, '0017', '0.00', 0, '', 5, '2016-02-24 11:53:19', '2016-02-24 11:55:18', 1, 0, 0, 'default', '', '0.0000', '0.0000', '0.000000', '0.00', 0, '0.0000', 'Brabo_logo.png', 0, 0, 0, 0.00, 0, 0, 0, '0.0000', 0, 0, 0, 1, 'Brabo', 'Brabo', '', '<p>Enjoy <strong>50% off bottles of wine</strong> and sit back and get to know each other.</p>\r\n<p>Courtesy of Brabo</p>\r\n<p>Timing: Wednesday nights 5pm-9pm</p>\r\n<p>1600 King Street Alexandria, VA 22314</p>\r\n<p>Making a reservation is recommended: </p>\r\n<p>http://www.braborestaurant.com/reservation/reservation.htm</p>', '', '', '', '', '22314', 'Alexandria', 'Virginia', '-77.0529', '38.806');
