(45, 'sponsors_list', 'LincUpTM Offers', 'Linc UpTM Offers', 'Linc UpTM Offers', 'Linc UpTM Offers', 'Linc UpTM Offers', '<p style="text-align: left;"><strong>We make getting together easy.</strong></p>\r\n<p>Choosing a place to meet can be a nightmare.  We aim to eliminate that, so you can focus on your date and simply enjoy the experience. Just put in your zip code and boom, a list of local, certified date spots. </p>\r\n<p>"<span style="font-weight: bold;">Linc Up™ Offers</span>" are currently available in the greater<span style="font-weight: bold;"> DC, Maryland & Virginia area.</span></p>\r\n<p>We are working hard to bring offers to your area in the next couple months.  In the mean time you can still use the site to meet new people.</p>\r\n<p>Have a date in mind? View <a href="friends">Connections</a> to see who you’re cool with.</p>', NULL),
