(59, 'about', 'About', 'About Us', 'About Us', 'About Us', 'About Us...', '<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"> </p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; font-family: Aileron, serif;"><strong>We are a free dating site and we use a Token system.</strong>  </span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; font-family: Aileron, serif;">It''s simple, Tokens are used to not only enhance your online experience, but also limit you from spreading yourself too thin.  Sometimes online dating can be overwhelming.  </span></p>\r\n<p class="MsoNormal" style="margin: 0in 0in 7.5pt 0.5in; text-indent: -0.25in; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; font-family: ''Times New Roman'';">        </span></span><span style="font-size: 13.5pt; font-family: Aileron, serif;">First, receiving a bunch of messages in your inbox with the same generic "what''s up" is not cool.  </span></p>\r\n<p class="MsoNormal" style="margin: 0in 0in 7.5pt 0.5in; text-indent: -0.25in; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; font-family: ''Times New Roman'';">        </span></span><span style="font-size: 13.5pt; font-family: Aileron, serif;">Second, sending a bunch of messages or crafting one incredible message with the hopes of a reply, but not receiving anything back can be frustrating.  </span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; font-family: Aileron, serif;">We eliminate all of that off the bat.  You get <b>20 Tokens each month</b>, send one to someone you’re interested in, if they accept it, you can craft that super witty message and know that you will get a response, if they don''t accept, you save your time and move on to the next one.  And no worries if you run out of Tokens before the end of the month, there’s lots of interesting ways you can earn more. </span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><strong><span style="font-size: 13.5pt; font-family: Aileron, serif;">Cool With it</span><span style="font-size: 14pt;">™ </span><span style="font-size: 13.5pt; font-family: Aileron, serif;">makes dating fun, honest and less expensive.</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><b><span style="font-size: 13.5pt; font-family: Aileron, serif;">Fun</span></b></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; font-family: Aileron, serif;">So we’re free…always.  That may not be the exact definition of fun, but we think if we can keep money in your pocket, the more opportunities for fun you can have. Not only that, we give you guys a cool space to connect, converse, post and see all the cool things to do in your area, so you can have fun together. </span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><b><span style="font-size: 13.5pt; font-family: Aileron, serif;">Honest</span></b></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; font-family: Aileron, serif;">Let’s face it, weirdos and spambots exist in the interwebs.  We hope to cut that down by providing an environment where you feel safe and not have to constantly have a creepy vibe when you log in.  We start with basic stuff like Facebook authentication and email verification, but also provide an honesty feedback rating system. If everything on your dates’ profile matches up when you meet them in real life, you let us know and it shows they’ve been reviewed on their profile.  And the bonus is you earn Tokens by doing this.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><b><span style="font-size: 13.5pt; font-family: Aileron, serif;">Less expensive</span></b></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; font-family: Aileron, serif;">Not to beat a dead horse, but we are free and will be forever. We also take you out and cut down on the cost of dating by working with local restaurants and businesses to offer you exclusive deals on date ideas we call Linc Ups.™  </span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; font-family: Aileron, serif;">Raise your hand if you have experienced this conversation:</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><i><span style="font-size: 13.5pt; font-family: Aileron, serif;">“What do you want to do?” </span></i></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><i><span style="font-size: 13.5pt; font-family: Aileron, serif;">“I don’t know, what do you want to do?” </span></i></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; line-height: 107%; font-family: Aileron, serif;">Okay, you can put your hand down now.  Linc Ups™ help eliminate this dialog that can make dating a bit annoying at times.  So we''ll notify you when we have deals in your area.  Just use your Tokens to redeem, at no cost to you, and you’re good to go. </span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"> </p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><strong><span style="font-size: 13.5pt; font-family: Aileron, serif;">Want to connect or have a question?</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 150%; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; line-height: 150%; font-family: Aileron, serif;">For general inquiries, connect with us via social media or email us at: <a href="mailto:info@imcoolwithit.com">info@coolwithit.com</a></span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 150%; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; line-height: 150%; font-family: Aileron, serif;">For press inquiries, please email us at: <a href="mailto:press@imcoolwithit.com">press@coolwithit.com</a></span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 150%; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; line-height: 150%; font-family: Aileron, serif;">For support issues, please email us at: <a href="mailto:support@imcoolwithit.com">support@coolwithit.com</a></span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 150%; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 13.5pt; line-height: 150%; font-family: Aileron, serif;">We review every inquiry we receive and will do our best to reply in a timely manner!</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 150%; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"> </p>', 'about.jpg'),
