(61, 'terms', 'Terms', 'Terms', 'Terms', 'Terms', 'Terms of Use Agreement', '<p>Welcome to Coolwithit.com, the service for single adults to meet each other online, operated by SK III, LLC. ("SK III"). By using the Coolwithit.com Website, (the "Website") you agree to be bound by these Terms of Use (this "Agreement"), whether or not you register as a member of Coolwithit.com ("Member"). If you wish to become a Member and make use of the Coolwithit.com service (the "Service"), please read these Terms of Use. <strong>If you object to anything in this Agreement or the SK III, LLC Privacy Policy, do not use the Website or the Service</strong>. The Terms of Use are subject to change by SK III at any time, effective upon posting on the Coolwithit.com website, and your use of the Service after such posting will constitute acceptance by you of such changes.</p>\r\n<h3>1. Acceptance of Terms of Use Agreement.</h3>\r\n<p><strong>a. Electronic Agreement.</strong>This Agreement is an electronic contract that sets out the legally binding terms of your use of the Website and your membership in the Service. This Agreement may be modified by SK III from time to time, such modifications to be effective upon posting by SK III on the Website. This Agreement includes SK III''s Acceptable Use Policy for Content Posted on the Website, SK III''s Privacy Policy, SK III''s subscription policies and any notices regarding the Website. By accessing the Website or becoming a Member, you accept this Agreement and agree to the terms, conditions and notices contained or referenced herein.</p>\r\n<p><strong>b. Electronic Form.</strong>By accessing the Website or becoming a Member, you consent to have this Agreement provided to you in electronic form.</p>\r\n<p><strong>c. Non-electronic Copy.</strong>You have the right to receive this Agreement in non-electronic form. You may request a non-electronic copy of this Agreement either before or after you electronically sign the Agreement. To receive a non-electronic copy of this Agreement, please send an e-mail to info@imcoolwithit.com.</p>\r\n<p><strong>d. Withdrawing Your Consent.</strong>You have the right at any time to withdraw your consent to have this Agreement provided to you in electronic form.</p>\r\n<ol type="I">\r\n<li>\r\n<p><strong>Effect.</strong>Should you choose to withdraw your consent to have this Agreement provided to you in electronic form, we will discontinue your then-current username and password. This means that you will not have the right to use the Service unless, and until, we issue you a new username and password. We only will issue you a new username and password after we receive a signed copy of a non-electronic version of this Agreement, which we will send to you upon request.</p>\r\n</li>\r\n<li>\r\n<p><strong>Notice.</strong>To withdraw your consent and/or request a non-electronic copy of this Agreement, please send an email to info@imcoolwithit.com.</p>\r\n</li>\r\n<li>\r\n<p><strong>Prospective Nature.</strong>Your withdrawal of consent shall be effective within a reasonable time after we receive your withdrawal notice described above. Your withdrawal of consent will not affect the legal validity or enforceability of the Agreement provided to, and electronically signed by, you prior to the effective date of your withdrawal.</p>\r\n</li>\r\n</ol>\r\n<p><strong>e. Access and Retention.</strong>In order to access and retain this electronic Agreement, you must have access to the World Wide Web, either directly or through devices that access web-based content, and pay any service fees associated with such access. In addition, you must use all equipment necessary to make such connection to the World Wide Web, including a computer and modem or other access device. Please print a copy of this document for your records. To retain an electronic copy of this Agreement, you may save it into any word processing program. Via, the Website, we will notify you of any changes in the hardware or software requirements needed to access and/or retain this Agreement that create a material risk that you will not be able to continue to access and/or retain this electronic Agreement.</p>\r\n<h3>2. Eligibility.</h3>\r\n<p>You must be at least eighteen (18) years of age and single or separated from your spouse to register as a member of Coolwithit.com or use the Website. Membership in the Service is void where prohibited. By using the Website, you represent and warrant that you have the right, authority and capacity to enter into this Agreement and to abide by all of the terms and conditions of this Agreement.</p>\r\n<h3>3. Membership and Subscription</h3>\r\n<p><strong>AT NOTIME WILL WE EVER REQUEST YOUR PERSONAL INFORMATION SUCH AS CREDIT CARD NUMBER OR PERSONAL HOME ADDRESS</strong> You may become a Member of the Service at no cost. As a Member, you will have the ability to participate in all of the features and services available within the Service. In SOME INSTANCE MEMBERS WILL BE REQUIRED TO USE EARNED TOKENS in order to access additional features and services, including the ability to communicate with other Members, view private pictures or other features. From time to time, SK III may remove the profiles of subscribers.</p>\r\n<h3>4. Term.</h3>\r\n<p>This Agreement will remain in full force and effect while you use the Website and/or are a Member. You may terminate your membership and/or subscription at any time, for any reason, by following the instructions on the Resign pages in Account Settings, or by sending SK III written notice of termination to info@imcoolwithit.com. If you resign or cancel your membership and/or subscription via the SK III site, to help SK III analyze and improve the Service, you may be asked to provide a reason for your resignation/cancellation. You may bypass this brief resignation survey page and continue the resignation/cancellation process by clicking the “Continue Cancellation” or other similar button on the page. If you terminate your subscription, your subscription will remain active until the end of your then-current subscription period (that is, the subscription period through which you had paid prior to your termination). SK III may terminate your membership and/or subscription by sending notice to you at the email address you provide in your application for membership, or such other email address as you may later provide to SK III. All decisions regarding the termination of accounts shall be made in the sole discretion of SK III. SK III is not required to provide you notice prior to terminating your membership and/or subscription. SK III is not required, and may be prohibited, from disclosing a reason for the termination of your account. Even after your membership or subscription is terminated, this Agreement will remain in effect. All terms that by their nature may survive termination of this Agreement shall be deemed to survive such termination.</p>\r\n<h3>5. Non-commercial Use by Members.</h3>\r\n<p>The Website is for the personal use of individual Members only and may not be used in connection with any commercial endeavors. Organizations, companies, and/or businesses may not become Members and should not use the Service or the Website for any purpose. Illegal and/or unauthorized uses of the Website, including collecting usernames and/or email addresses of members by electronic or other means for the purpose of sending unsolicited email and unauthorized framing of or linking to the Website may be investigated, and appropriate legal action will be taken, including without limitation, civil, criminal, and injunctive redress. Use of the Website is with the permission of SK III, which may be revoked at any time, for any reason, in SK III''s sole discretion.</p>\r\n<h3>6. Account Security.</h3>\r\n<p>You are responsible for maintaining the confidentiality of the username and password that you designate during the Registration process, and you are fully responsible for all activities that occur under your username and password. You agree to (a) immediately notify SK III of any unauthorized use of your username or password or any other breach of security, and (b) ensure that you exit from your account at the end of each session. SK III will not be liable for any loss or damage arising from your failure to comply with this provision. You should use particular caution when accessing your account from a public or shared computer so that others are not able to view or record your password or other personal information. If you share your computer with others, you may wish to consider disabling your auto-sign in feature since your Facebook account and your SK III account are linked.</p>\r\n<h3>7. Your Interactions with Other Members.</h3>\r\n<p>You are solely responsible for your interactions with other Members. You understand that SK III does not in any way screen its Members, nor does SK III inquire into the backgrounds of its Members or attempt to verify the statements of its Members. SK III makes no representations or warranties as to the conduct of Members or their compatibility with any current or future Members. In no event shall SK III be liable for any damages whatsoever, whether direct, indirect, general, special, compensatory, consequential, and/or incidental, arising out of or relating to the conduct of you or anyone else in connection with the use of the Service, including without limitation, bodily injury, emotional distress, and/or any other damages resulting from communications or meetings with other registered users of this Service or persons you meet through this Service. You agree to take reasonable precautions in all interactions with other Members of the Service, particularly if you decide to meet offline or in person. In addition, you agree to review Dating Safety Tips prior to using the Service. You understand that SK III makes no guarantees, either express or implied, regarding your ultimate compatibility with individuals you meet through the Service. You should not provide your financial information (for example, your credit card or bank account information) to other Members.</p>\r\n<h3>8. Content on SK III.</h3>\r\n<p><strong>a. Proprietary Rights.</strong> SK III owns and retains all proprietary rights in the Website and the Service. The Website contains the copyrighted material, trademarks, and other proprietary information of SK III, and its licensors. Except for that information which is in the public domain or for which you have been given written permission, you may not copy, modify, publish, transmit, distribute, perform, display, or sell any such proprietary information.</p>\r\n<p><strong>b. Reliance on Content, Advice, Etc.</strong> Opinions, advice, statements, offers, or other information or content made available through the Service, but not directly by SK III, are those of their respective authors, and should not necessarily be relied upon. Such authors are solely responsible for such content. SK III does not: (i) guarantee the accuracy, completeness, or usefulness of any information on the Service, or (ii) adopt, endorse or accept responsibility for the accuracy or reliability of any opinion, advice, or statement made by any party that appears on the Website. Under no circumstances will SK III or its affiliates be responsible for any loss or damage resulting from your reliance on information or other content posted on the Website or transmitted to or by any Members.</p>\r\n<h3>9. Content Posted by You on SK III.</h3>\r\n<p>a. You are solely responsible for the Content that you publish or display (hereinafter, "post") on the Service, or transmit to other Members. You will not post on the Service, or transmit to other Members, any defamatory, inaccurate, abusive, obscene, profane, offensive, sexually oriented, threatening, harassing, racially offensive, or illegal material, or any material that infringes or violates another party''s rights (including, but not limited to, intellectual property rights, and rights of privacy and publicity). You will not provide inaccurate, misleading or false information to the Company or to any other Member. If information provided to SK III, or another Member, subsequently becomes inaccurate, misleading or false, you will promptly notify SK III of such change.</p>\r\n<p>b. You understand and agree that SK III may review and delete any content, messages, double-blind emails, photos or profiles (collectively, "Content"), in each case in whole or in part, that in the sole judgment of SK III violate this Agreement or which might be offensive, illegal, or that might violate the rights, harm, or threaten the safety of Members.</p>\r\n<p>c. By posting Content to any public area of SK III, you automatically grant, and you represent and warrant that you have the right to grant, to SK III, its affiliates, licensees and successors, an irrevocable, perpetual, non-exclusive, fully paid, worldwide license to use, copy, perform, display, reproduce, adapt, modify and distribute such information and content and to prepare derivative works of, or incorporate into other works, such information and content, and to grant and authorize sublicenses of the foregoing. You further represent and warrant that public posting and use of your content by SK III will not infringe or violate the rights of any third party.</p>\r\n<p>d. The following is a partial list of the kind of Content that is illegal or prohibited on the Website. SK III reserves the right to investigate and take appropriate legal action in its sole discretion against anyone who violates this provision, including without limitation, removing the offending communication from the Service and terminating the membership of such violators. It includes, but is not limited to, Content that:</p>\r\n<ul>\r\n<li>is patently offensive to the online community, such as Content that promotes racism, bigotry, hatred or physical harm of any kind against any group or individual;</li>\r\n<li>harasses or advocates harassment of another person;</li>\r\n<li>involves the transmission of "junk mail", "chain letters," or unsolicited mass mailing or "spamming";</li>\r\n<li>promotes information that you know is false, misleading or promotes illegal activities or conduct that is abusive, threatening, obscene, defamatory or libelous;</li>\r\n<li>promotes an illegal or unauthorized copy of another person''s copyrighted work, such as providing pirated computer programs or links to them, providing information to circumvent manufacture-installed copy-protect devices, or providing pirated images, audio or video, or links to pirated images, audio or video files;</li>\r\n<li>contains restricted or password only access pages, or hidden pages or images (those not linked to or from another accessible page);</li>\r\n<li>provides material that exploits people under the age of 18 in a sexual or violent manner, or solicits personal information from anyone under the age of 18;</li>\r\n<li>provides instructional information about illegal activities such as making or buying illegal weapons, violating someone''s privacy, or providing or creating computer viruses;</li>\r\n<li>solicits passwords or personal identifying information for commercial or unlawful purposes from other users; and</li>\r\n<li>engages in commercial activities and/or sales without our prior written consent such as contests, sweepstakes, barter, advertising, and pyramid schemes.</li>\r\n</ul>\r\n<p>e. Your use of the Service, including but not limited to the Content you post on the Service, must be in accordance with any and all applicable laws and regulations.</p>\r\n<p>f. You may not include in your Member profile any telephone numbers, street addresses, last names, URLs or email addresses.</p>\r\n<p>g. You may not engage in advertising to, or solicitation of, other Members. This includes but is not limited to solicitation or advertising to buy or sell any products or services through the Service or to attend parties or other social functions or networking for commercial purposes. You may not transmit any chain letters or junk email to other Members. Although SK III cannot monitor the conduct of its Members off the Website, it is also a violation of these rules to use any information obtained from the Service in order to harass, abuse, or harm another person, or in order to contact, advertise to, solicit, or sell to any Member without their prior explicit consent. In order to protect our Members from such advertising or solicitation, we reserve the right to restrict the number of emails which a Member may send to other Members in any 24-hour period to a number which we deem appropriate in our sole discretion.</p>\r\n<p>h. All information you include in your Member profile must be accurate, current and complete.</p>\r\n<h3>10. Prohibited Activities.</h3>\r\n<p>SK III reserves the right to investigate and terminate your membership if you have misused the Service, or behaved in a way which could be regarded as inappropriate or whose conduct is unlawful or illegal. The following is a partial list of the type of actions that you may not engage in with respect to the Service:</p>\r\n<ul>\r\n<li>You will not impersonate any person or entity.</li>\r\n<li>You will not "stalk" or otherwise harass any person.</li>\r\n<li>You will not express or imply that any statements you make are endorsed by SK III without our specific prior written consent.</li>\r\n<li>You will not use any robot, spider, site search/retrieval application, or other manual or automatic device or process to retrieve, index, "data mine", or in any way reproduce or circumvent the navigational structure or presentation of the Service or its contents.</li>\r\n<li>You will not post, distribute or reproduce in any way any copyrighted material, trademarks, or other proprietary information without obtaining the prior consent of the owner of such proprietary rights.</li>\r\n<li>You will not remove any copyright, trademark or other proprietary rights notices contained in the Service.</li>\r\n<li>You will not interfere with or disrupt the Services or the site or the servers or networks connected to the Services or the site.</li>\r\n<li>You will not post, email or otherwise transmit any material that contains software viruses or any other computer code, files or programs designed to interrupt, destroy or limit the functionality of any computer software or hardware or telecommunications equipment.</li>\r\n<li>You will not forge headers or otherwise manipulate identifiers in order to disguise the origin of any information transmitted through the Service.</li>\r\n<li>You will not "frame" or "mirror" any part of the Service or the Website, without SK III’s prior written authorization. You also shall not use meta tags or code or other devices containing any reference to SK III or the Service or the site in order to direct any person to any other web site for any purpose.</li>\r\n<li>You will not modify, adapt, sublicense, translate, sell, reverse engineer, decipher, decompile or otherwise disassemble any portion of the Service or the Website or any software used on or for the Service or cause others to do so.</li>\r\n</ul>\r\n<h3>11. Customer Service.</h3>\r\n<p>SK III provides assistance and guidance through its customer care representatives. When communicating with our customer care representatives, you may not to be abusive, obscene, profane, offensive, sexist, threatening, harassing, racially offensive, or otherwise behave inappropriately. If we feel that your behavior towards any of our customer care representatives or other employees is at any time threatening or offensive, we reserve the right to immediately terminate your membership and you will not be entitled to any refund of unused subscription fees.</p>\r\n<h3>12. Subscriptions; </h3>\r\n<p><strong>a. General.</strong> SK III will never request or collect personal billing information as credit cards are not accepted by Cool with it.  Please do not share your personal information with other member on this site. </p>\r\n<p><strong>b. Current Information Required.</strong> Username, Age, Gender,</p>\r\n<h3>13. Modifications to Service.</h3>\r\n<p>SK III reserves the right at any time to modify or discontinue, temporarily or permanently, the Service (or any part thereof) with or without notice. You agree that SK III shall not be liable to you or to any third party for any modification, suspension or discontinuance of the Service.</p>\r\n<h3>14. Blocking of IP Addresses.</h3>\r\n<p>In order to protect the integrity of the Service, SK III reserves the right at any time in its sole discretion to block Members from certain IP addresses from accessing the Website.</p>\r\n<h3>15. Copyright Policy.</h3>\r\n<p>You may not post, distribute, or reproduce in any way any copyrighted material, trademarks, or other proprietary information without obtaining the prior written consent of the owner of such proprietary rights. Without limiting the foregoing, if you believe that your work has been copied and posted on the Service in a way that constitutes copyright infringement, please provide our Copyright Agent with the following information: an electronic or physical signature of the person authorized to act on behalf of the owner of the copyright interest; a description of the copyrighted work that you claim has been infringed; a description of where the material that you claim is infringing is located on the Website; your address, telephone number, and email address; a written statement by you that you have a good faith belief that the disputed use is not authorized by the copyright owner, its agent, or the law; a statement by you, made under penalty of perjury, that the above information in your notice is accurate and that you are the copyright owner or authorized to act on the copyright owner''s behalf. SK III''s Copyright Agent for notice of claims of copyright infringement can be reached as follows: info@imcoolwithit.com.</p>\r\n<h3>16. Member Disputes.</h3>\r\n<p>You are solely responsible for your interactions with other SK III Members. SK III reserves the right, but has no obligation, to monitor disputes between you and other Members.</p>\r\n<h3>17. Privacy.</h3>\r\n<p>Use of the Website and/or the Service is also governed by our Privacy Policy.</p>\r\n<h3>18. Disclaimers.</h3>\r\n<p>SK III is not responsible for any incorrect or inaccurate Content posted on the Website or in connection with the Service, whether caused by users of the Website, Members or by any of the equipment or programming associated with or utilized in the Service. SK III is not responsible for the conduct, whether online or offline, of any user of the Website or Member of the Service. SK III assumes no responsibility for any error, omission, interruption, deletion, defect, delay in operation or transmission, communications line failure, theft or destruction or unauthorized access to, or alteration of, user or Member communications. SK III is not responsible for any problems or technical malfunction of any telephone network or lines, computer online systems, servers or providers, computer equipment, software, failure of email or players on account of technical problems or traffic congestion on the Internet or at any Website or combination thereof, including injury or damage to users and/or Members or to any other person''s computer related to or resulting from participating or downloading materials in connection with the Web and/or in connection with the Service. Under no circumstances will SK III or any of its affiliates, advertisers, promoters or distribution partners be responsible for any loss or damage, including personal injury or death, resulting from anyone''s use of the Website or the Service, any Content posted on the Website or transmitted to Members, or any interactions between users of the Website, whether online or offline. The Website and the Service are provided "AS-IS" and SK III expressly disclaims any warranty of fitness for a particular purpose or non-infringement. SK III cannot guarantee and does not promise any specific results from use of the Website and/or the Service. In addition to the preceding paragraph and other provisions of this Agreement, any advice that may be posted on the Website is for informational and entertainment purposes only and is not intended to replace or substitute for any professional financial, medical, legal, or other advice. SK III makes no representations or warranties and expressly disclaims any and all liability concerning any treatment, action by, or effect on any person following the information offered or provided within or through the Website. If you have specific concerns or a situation arises in which you require professional or medical advice, you should consult with an appropriately trained and qualified specialist.</p>\r\n<h3>19. Links.</h3>\r\n<p>The Service may provide, or third parties may provide, links to other World Wide Web sites or resources. Because SK III has no control over such sites and resources, you acknowledge and agree that SK III is not responsible for the availability of such external sites or resources, and does not endorse and is not responsible or liable for any Content, advertising, products or other materials on or available from such sites or resources. You further acknowledge and agree that SK III shall not be responsible or liable, directly or indirectly, for any damage or loss caused or alleged to be caused by or in connection with the use of, or reliance upon, any such Content, goods or services available on or through any such site or resource.</p>\r\n<h3>20. Linked Accounts.</h3>\r\n<p>SK III permits you to associate a SK III username and password with your Facebook account. SK III is not responsible for the operation or functionality of Facebook. Facebook is a registered trademark of Facebook Inc.</p>\r\n<h3>21. Limitation on Liability.</h3>\r\n<p>Except in jurisdictions where such provisions are restricted, in no event will SK III be liable to you or any third person for any indirect, consequential, exemplary, incidental, special or punitive damages, including also lost profits arising from your use of the Web site or the Service, even if SK III has been advised of the possibility of such damages.</p>\r\n<h3>22. U.S. Export Controls.</h3>\r\n<p>Software from this Website (the "Software") is further subject to United States export controls. No Software may be downloaded from the Website or otherwise exported or re-exported (i) into (or to a national or resident of) Cuba, Iraq, Libya, North Korea, Iran, Syria, or any other Country to which the U.S. has embargoed goods; or (ii) to anyone on the U.S. Treasury Department''s list of Specially Designated Nationals or the U.S. Commerce Department''s Table of Deny Orders. By downloading or using the Software, you represent and warrant that you are not located in, under the control of, or a national or resident of any such country or on any such list.</p>\r\n<h3>23. Jurisdiction and Choice of Law.</h3>\r\n<p>If there is any dispute arising out of the Website and/or the Service, by using the Website, you expressly agree that any such dispute shall be governed by the laws of the State of Maryland, without regard to its conflict of law provisions, and you expressly agree and consent to the exclusive jurisdiction and venue of the state and federal courts of the State of Maryland, in Montgomery County, for the resolution of any such dispute.</p>\r\n<h3>24. Indemnity by You.</h3>\r\n<p>You agree to indemnify and hold SK III, its subsidiaries, affiliates, officers, agents, and other partners and employees, harmless from any loss, liability, claim, or demand, including reasonable attorney''s fees, made by any third party due to or arising out of your use of the Service in violation of this Agreement and/or arising from a breach of this Agreement and/or any breach of your representations and warranties set forth above.</p>\r\n<h3>25. No Third Party Beneficiaries.You agree that, except as otherwise expressly provided in this Agreement, there shall be no third party beneficiaries to this Agreement.</h3>\r\n<h3>26. Other.</h3>\r\n<p>This Agreement contains the entire agreement between you and SK III regarding the use of the Website and/or the Service. If any provision of this Agreement is held invalid, the remainder of this Agreement shall continue in full force and effect.</p>\r\n<p>Please contact us with any questions regarding this agreement. SK III is a trademark of SK III, LLC.</p>\r\n<p>I HAVE READ THIS AGREEMENT AND AGREE TO ALL OF THE PROVISIONS CONTAINED ABOVE.</p>\r\n<p>Click here to complete registration</p>', NULL);
