(62, 'privacy', 'Privacy', 'Privacy', 'Privacy', 'Privacy', 'Privacy Policy', '<p>Your privacy is important to Coolwithit.com and SK III, LLC (SK III). We have developed a Privacy Policy that covers how we collect, use, disclose, transfer, and store your information. Unless otherwise defined in this Privacy Policy, terms used in herein have the same meaning(s) as in the Terms of Use. Please take a moment to familiarize yourself with our privacy practices. </p>\r\n<p>Our goal in collecting information is to provide, and to continually improve our Service(s). SK III processes personal information to provide our own Service(s). In some cases, SK III may process personal information on behalf of and according to the instructions of a third party, such as our advertising partners; but, only when you have provided your express consent to allow us to do so.</p>\r\n<h3>Collection and Use of Information</h3>\r\n<p>SK III collects information when you use and access SK III’s Service(s) and website(s). The information collected includes Personal Information, Non-Personal Information, App Data and Share Data (hereinafter collectively referred to as “Customer Information”). “Personal Information” is information about you that is personally identifiable, like your full name, address, email address, billing information, passwords, telephone number. “App Data” is information about the nature of your usage of SK III’s websites, products and the Service, and “Non-Personal” demographic information. App Data can include: IP addresses, domain servers, referring/exit pages, operating system information, unique device identifier (UDID), date/time stamp, clickstream data, messages sent and received using SK III’s Service, information about those messages, type of device, location information, user age and gender demographics, type of web browser, one or more cookies that identify your browser and telecommunications carrier information. Non-Personal Information includes data in a form that does not permit direct association with any individual. Some examples of Non-Personal Information can include: occupation, language, zip code, area code and time zone where the Service is used. “Share Data” is data and information you provide for use with SK III’s Service and which may be made available to third parties by your actions when using the SK III Service, which constitutes your consent for SK III’s use of Share Data as so directed by you. Share Data may include information from other social networking sites, and your profile(s) and information thereon, made available to third parties by your actions when using the SK III Service, which also constitutes your consent for SK III’s use of Share Data. </p>\r\n<p><strong>For Publishers and Advertisers (Not Dating Members)</strong>: Different types of information may be needed to develop and register and access your account; in addition to collecting your email, we also provide you with the option of providing us with additional information including your name, address, PayPal or financial account information such as your VAT or sales tax information or any other relevant tax or credit card information.   If a publisher or advertiser chooses to provide SK III LLC with this information, SK III LLC will encrypt the transmission of that information with secure socket layer (SSL) technology and utilize a credit card company to process your payment information.</p>\r\n<p>SK III uses information we collect to:</p>\r\n<ul>\r\n<li>keep members posted on SK III’s latest Service announcements and updates</li>\r\n<li>help us to improve our Services, content, and advertising</li>\r\n<li>help us develop, deliver, and improve our <strong>PRODUCTS, CONTENT, ADVERTISING, and the SERVICE</strong></li>\r\n<li>from time to time, send important notices, such as communications about changes to our terms, conditions, and policies; and, you cannot opt-out of receiving these communications</li>\r\n<li>perform such internal purposes such as auditing, data analysis, and research to improve SK III’s products, Services, and customer communications</li>\r\n<li>help us provide more useful information to our users and to understand which parts of our products and Service(s) are of most interest. </li>\r\n</ul>\r\n<p>SK III may also collect information regarding user activities on our Service and websites. This information is aggregated and used to help us provide more useful information to our users, and to understand which parts of our Service and websites are of most interest. Aggregated data is considered Non-Personal information for the purposes of this Privacy Policy. </p>\r\n<p>If we combine Non-Personal Information with Personal Information, the combined information will be treated as Personal Information for as long as it remains combined. </p>\r\n<p>General Information. We receive and store information you knowingly provide to us. For example, during the registration process, we collect basic Personal Information such as your user name, email address, gender, and age in order to contact you, as well as, share obvious information necessary to communicate with other members on the site i.e. user name, age and gender.  We may collect other Personal Information you provide us through your use of SK III – for example, if you respond to a survey or otherwise interact with SK III. You can choose not to provide us with certain information, but then you may not be able to take advantage of many of our special features.  We NEVER ASK FOR, ACCEPT OR COLLECT PERSONAL CREDIT CARDS OR CREDIT CARD INFORMATION.  WE NEVER ACCEPT OR COLLECT MEMBERS HOME ADDRESS OR OTHER SUCH PERSONAL INFORMATION.</p>\r\n<h3>Information Sharing and Disclosure</h3>\r\n<p>SK III uses user information to enhance your use of the SK III Services by processing such information for various purposes, including improving and providing SK III’s Service, notifications, delivery of advertisements and related links, for sending, sharing and storing your Share Data as you direct through use of the Service, and other purposes relating to offering you the Service. </p>\r\n<h3>Cookies and Other Technologies</h3>\r\n<p>SK III’s website, Service(s), surveys and/or and advertisements may use “cookies” and other technologies such as pixel tags and web beacons. These technologies help us better understand user behavior, tell us which parts of our Service people have used, and facilitate and measure the effectiveness of advertisements and web searches. We treat information collected by cookies and other technologies as Non-Personal information. However, to the extent that Internet Protocol (IP) addresses or similar identifiers are considered personal information by local law, we also treat these identifiers as Personal Information. </p>\r\n<p>SK III and its partners use cookies and other technologies in mobile advertising services to control the number of times you see a given ad deliver ads that relate to your interests, and measure the effectiveness of ad campaigns. </p>\r\n<p>SK III and our partners use cookies and other technologies to remember personal information when you use our website, applications and the Service. Our goal in these cases is to make your experience with SK III more convenient and personal. Knowing someone using your device has shopped for a certain product or used a particular service helps us make our advertising more relevant to your interests. </p>\r\n<p>As is true of most websites, we gather some information automatically and store it in log files. This information includes Internet Protocol (IP) addresses, browser type and language, Internet Service Provider (ISP), referring and exit pages, operating system, date/time stamp, and clickstream data. We use this information to understand and analyze trends, to administer the site, to learn about user behavior on the site and with the Service, and to gather demographic information about our user base as a whole.  SK III may use this information in our marketing and advertising services. </p>\r\n<h3>Disclosure to Third Parties</h3>\r\n<p>At times SK III may make certain Personal Information available to strategic partners that work with SK III to provide products and services, or that help SK III market to customers. Personal information will only be shared by SK III to provide or improve our products, services and advertising: it will not be shared with third parties for their direct marketing purposes. </p>\r\n<p>SK III shares Personal Information with companies who provide services such as information processing, extending credit, fulfilling customer orders, delivering products to you, managing and enhancing customer data, providing customer service, assessing your interest in our Services, and conducting customer research or satisfaction surveys. These companies are obligated to protect your information and may be located wherever SK III operates. </p>\r\n<p>It may be necessary—by law, legal process, litigation, and/or requests from public and governmental authorities within or outside your country of residence—for SK III to disclose your Personal Information. We may also disclose information about you if we determine that for purposes of national security, law enforcement, or other issues of public importance, disclosure is necessary or appropriate.</p>\r\n<p>SK III may also disclose information about you if we determine that disclosure is reasonably necessary to enforce our terms and conditions or protect our operations or users. </p>\r\n<p>In the event of a reorganization, merger, or sale we may transfer any and all Personal Information we collect to the relevant third party.</p>\r\n<h3>Protection of Personal Information; Security; and Data Integrity</h3>\r\n<p>SK III has physical, electronic, and procedural safeguards to protect the loss, misuse, and alteration of the Customer Information under our control. Customer Information we collect is stored in a secure manner that is accessible only by authorized SK III personnel, contractors, and agents bound by confidentiality obligations and is only disclosed under the provisions of this Privacy Policy. </p>\r\n<p>Our processing of personal information is only for the purposes for which it is collected in accordance with this Privacy Policy. </p>\r\n<p>Periodically, SK III undertakes a review of its privacy practices to ensure that the information we collect is needed to provide or improve the Service. </p>\r\n<h3>Integrity and Retention of Personal Information</h3>\r\n<p>SK III makes it easy for you to keep your Personal Information accurate, complete, and up-to-date. We will retain your personal information for the period necessary to fulfill the purposes outlined in this Privacy Policy unless a longer retention period is required or permitted by law. </p>\r\n<h3>Children</h3>\r\n<p>SK III does not knowingly collect Personal Information from children under Thirteen (13). SK III complies with the Children’s Online Privacy Protection Act (“COPPA”). <span style="text-decoration: underline;"><strong>SK III prohibits the registration for and/or use of the Service by anyone under the age of 18</strong></span>. If we learn that we have collected the Personal Information of a child under the age of 18, we will take the steps to delete the information, in a secure manner, as soon as possible. </p>\r\n<h3>Location-Based Services</h3>\r\n<p>To provide location-based services on SK III websites and the Service, SK III and our partners and licensees may collect, use, and share precise location data, including the real-time geographical location of your device. This location data is collected anonymously in a form that does not personally identify you and is used by SK III and our partners and licensees to provide and improve location-based products and services. </p>\r\n<h3>Third-Party Sites and Services</h3>\r\n<p>SK III websites, applications, and the Service may contain links to third-party websites, products, and services. Information collected by third parties, which may include such things as location data or contact details, is governed by the third-parties’ privacy practices. We encourage you to learn about the privacy practices of those third-parties.  SK III is not responsible for the privacy practices or content of any of these third-party sites. </p>\r\n<h3>International Users</h3>\r\n<p>Information you provide may be transferred or accessed by entities around the world as described in this Privacy Policy. SK III abides by the “safe harbor” framework set forth by the U.S. Department of Commerce regarding the collection, use, and retention of personal information collected by organizations in the European Economic Area and Switzerland. (Include link to U.S. Department of Commerce Safe Harbor Program)</p>\r\n<h3>Instagram, Facebook and Other Social media Features:</h3>\r\n<p>SK III may allow users to use social features, such as Facebook Connect, offered by Facebook or other third-party social networking sites (“SNS”) to interact with friends. If you opt to use such a service, by proceeding, you are allowing SK III to access and use certain of your information maintained by the SNS, and you are agreeing to the Terms of Use provided by that SNS. By way of example, and depending on the privacy settings you have chosen at a given SNS, you might interact with friends who are also members of that SNS by automatically sharing your game reviews or other SK III activity through the SNS (e.g., in the case of Facebook, by choosing to have your SK III reviews automatically posted on your Timeline or choosing to use Facepile to post the Facebook profile pictures of users who have connected with your page), or by keeping up on your friends’ SK III activity through their own automatic SNS account postings (e.g., on their updates shown on your Facebook Newsfeed).</p>\r\n<p>If you are not currently registered with SK III you can use Facebook Connect to register; when you click on “Sign in Using Facebook”, you will first be asked to enter your Facebook credentials and then be given the option to register and join SK III. Once you register with SK III and connect your Facebook credentials, you will be able to automatically post recent activity back to Facebook (i.e., on your Facebook Wall or Timeline). You have the option to disable Facebook Connect or similar SNS services at any time by logging into “My Profile” on your SK III account and clicking on “Social Settings”. You can also edit your privacy settings on the SNS itself (such as Facebook) to control the extent to which your activity on SK III appears on Facebook, or to disconnect the Facebook Connect service, by visiting the Facebook Application Settings page.</p>\r\n<h3>Access to Personal Information</h3>\r\n<p>If you want us to remove your Personal Information from our database, or would like to access the Personal Information that was collected from you, you can contact us using the contact information provided below. Certain of our products and services require the use of App Data and such data is retained by SK III and used as described in this Privacy Policy. We make good faith efforts to provide you with access so you can request that we correct the data if it is inaccurate or delete the data if SK III is not required to retain it by law or for legitimate business purposes. We may decline to process requests that are unreasonably repetitive, require disproportionate technical effort, jeopardize the privacy of others, are extremely impractical, or for which access is not otherwise required by law. </p>\r\n<h3>Business Transfers:</h3>\r\n<p>In the event of a merger, acquisition, reorganization, change of control, sale of all or substantially all of its assets, or the sale of an individual mobile or web properties owned by us, customer information is typically one of the business assets that is transferred and we may therefore transfer and/or disclose your Personal Information to the prospective seller or buyer of such business or assets or to a third party as a part of such merger, acquisition, reorganization, or sale. In addition, if we go out of business or enter bankruptcy, Personal Information would be one of the assets transferred to or acquired by a third party.</p>\r\n<h3>Modifications and Updates to Privacy Policy</h3>\r\n<p>SK III may update its Privacy Policy from time to time. When we change the policy in a material way, a notice will be posted on our website along with the updated Privacy Policy. Your continued use of the SK III Service and/or any SK III website following the posting of changes will mean you accept these changes. Use of information that we gather is subject to the Privacy Policy in effect at the time of use. </p>\r\n<h3>Our Company-wide Commitment to Your Privacy</h3>\r\n<p>To make sure your personal information is secure; we communicate our privacy and security guidelines to SK III employees, and strictly enforce privacy safeguards within the company. </p>\r\n<h3>Privacy Questions</h3>\r\n<p>If you have any questions or concerns about SK III’s Privacy Policy or data processing procedures, please contact us at: info@imcoolwithit.com. If we receive formal privacy-related complaints, it is our policy to use reasonable efforts to communicate with the complaining party about its concerns to resolve privacy complaints. </p>', NULL),
