(64, 'faqs', 'FAQ''s', 'FAQ''s', 'FAQ''s', 'FAQ''s', 'Some Commonly asked Questions...', '<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">How do I earn Tokens? Will I ever have to pay anything?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><b><span style="font-size: 10.5pt; font-family: Aileron, serif;">No.  We will never ask for your credit card. </span></b><span style="font-size: 10.5pt; font-family: Aileron, serif;">  We designed this site to allow you to earn Tokens for being honest, taking surveys from brands you like, or referring a friend for example.  We also give you 20 Tokens a month, every month.   This helps us to pay for the costs of running this site, and allows our sponsors to offer you special offers for Linc Ups</span><span style="font-size: 10.5pt; font-family: ''Times New Roman'', serif;">™</span><span style="font-size: 10.5pt; font-family: Aileron, serif;"> you can redeem with your Tokens.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">What’s with the Tokens? How do I use them?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><b><span style="font-size: 10.5pt; font-family: Aileron, serif;">Connect with members</span></b><span style="font-size: 10.5pt; font-family: Aileron, serif;">: Tokens are used to contact other members you are interested in.  See someone you would like to get to know? Send them a Token. If they accept your friend request, they will put up a Token as well.  Then you are both free to message each other.  </span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><b><span style="font-size: 10.5pt; font-family: Aileron, serif;">View Private Photos</span></b><span style="font-size: 10.5pt; font-family: Aileron, serif;">: Use your Tokens to view your connections private photos.  These are photos they might not want to share with everyone, so it is just limited to their connections.</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><b><span style="font-size: 10.5pt; font-family: Aileron, serif;">Link up!</span></b><span style="font-size: 10.5pt; font-family: Aileron, serif;">  Use your Tokens to get together. Just check your Linc Up</span><span style="font-size: 10.5pt; font-family: ''Times New Roman'', serif;">™</span><span style="font-size: 10.5pt; font-family: Aileron, serif;"> offers for ideas on get togethers like coffee, bowling, sporting events and more. </span></p>\r\n<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">How does the Honesty Feedback Ratings work?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">Members are rewarded with Tokens for taking our standard 3 question survey on members they have met through Cool with it</span><span style="font-size: 10.5pt;">™</span><span style="font-size: 10.5pt; font-family: Aileron, serif;">.  The survey consists of 3 multiple choice questions.  Members are asked to review how honest the other member was in their description of themselves prior to meeting, based upon three basic categories:</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10pt; font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">         </span></span><span style="font-size: 10.5pt; font-family: Aileron, serif;">Their Physical Appearance</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10pt; font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">         </span></span><span style="font-size: 10.5pt; font-family: Aileron, serif;">Their Personal Story</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10pt; font-family: Symbol;">·<span style="font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">         </span></span><span style="font-size: 10.5pt; font-family: Aileron, serif;">Their Relationship Status</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">Members who take the survey are rewarded with 5 Interest Tokens.  Only positive reviews will be displayed on the other members profile in the form of a number.  One positive review = 1 Honesty Survey.  Members who receive a positive review will be alerted and will earn 5 Interest Tokens as well, for keeping it honest.</span></p>\r\n<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">Why can I login through Facebook?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">All Cool with it™ users have the option to sign in with their Facebook account to help validate their identity.  We think that this makes dating a bit more honest and helps prove you actually exist!  </span></p>\r\n<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">Are you going to post anything on my timeline?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">No, we will never post to your timeline. Facebook may display that you’ve downloaded the app, but you can prevent this by changing the visibility settings to “Only Me” in the app center preferences.</span></p>\r\n<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">Is my activity within Cool with it</span><span style="font-size: 22.5pt;">™</span><span style="font-size: 22.5pt; font-family: inherit, serif;"> private?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">We let you know when someone has checked out your profile and sent you a Token.  Other than that you are notified when a member has sent you a message, sent you a Linc Up invite, or has paid an Interest Token to view your private pictures.  (Only connections can view your private photos or message you.) </span></p>\r\n<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">What do you do with my information?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">All information provided to Cool with it through Facebook (including your photos and email address) are never sold or distributed to any third parties. We only use information you give us exclusively to make your experience on Cool with it</span><span style="font-size: 10.5pt; font-family: ''Times New Roman'', serif;">™</span><span style="font-size: 10.5pt; font-family: Aileron, serif;"> better.   For example, to notify you when certain brands are interested in talking with you in exchange for Interest Tokens.  You can disconnect Cool with it</span><span style="font-size: 10.5pt; font-family: ''Times New Roman'', serif;">™</span><span style="font-size: 10.5pt; font-family: Aileron, serif;"> from your Facebook account at any time, and we will immediately delete all of your personal information.</span></p>\r\n<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">Why do you ask for access to my email address?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">We need your email to send you information on special date night offers you may redeem from the local businesses and restaurants we work with to help making getting together a bit easier.</span></p>\r\n<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">Why do you ask for access to my pictures?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">So members can see who you are ;)</span></p>\r\n<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">What about the rest of my info?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">Your work history, education history, likes etc. are used when we introduce you to someone new. The more information we have, the better introduction we can make, and the easier it is to get the conversation started.</span></p>\r\n<p class="MsoNormal" style="margin: 15pt 0in 7.5pt; line-height: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 22.5pt; font-family: inherit, serif;">Can I permanently remove my information and delete my account?</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 7.5pt; line-height: 15pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="font-size: 10.5pt; font-family: Aileron, serif;">Of course. To uninstall Cool with it</span><span style="font-size: 10.5pt;">™</span><span style="font-size: 10.5pt; font-family: Aileron, serif;">: Click https://www.facebook.com/settings?tab=applications from a desktop computer (will not work from mobile device) and remove the app from the list. Then, on your phone, delete the app icon as you normally would. Please note, if you choose to reinstall Cool with it</span><span style="font-size: 10.5pt; font-family: ''Times New Roman'', serif;">™</span><span style="font-size: 10.5pt; font-family: Aileron, serif;"> later, you will be starting fresh!</span></p>', NULL),
(65, 'sponsors', 'Sponsors', 'Sponsors', 'Sponsors', 'Sponsors', 'Current LincUp offers in your area:', '<p>I''m Cool with it...<span style="vertical-align: baseline; font-size: 10px;">tm </span>is free to use anywhere in the USA.</p>\r\n<p><strong>"Linc </strong><span style="font-weight: bold;">Up Offers</span>" are currently available in the greater<span style="font-weight: bold;"> DC, Maryland & Virginia area.</span></p>\r\n<p>We are working hard to bring offers to your area in the next couple months.  In the mean time you can still use the site to meet new people.</p>\r\n<p>Enter your zip code to view current sponsors and their date night meet up offers and thanks for the support.</p>', NULL),
