(93, 'community', 'Community', 'Community', 'Community', 'Community', 'Cool with it... Community', '<h3>Welcome to the Cool with it…Community Page! </h3>\r\n<p>Here, you will be able to share and learn about great date ideas, places to try, or cool upcoming events in the area.  You also get to interact with other members...someone may share your love of that Italian place in your neighborhood, and who knows, you could LincUp for a date there.</p>\r\n<p>We can’t wait to see your ideas, share some of our own, and help you make more connections!</p>\r\n<p>Sincerely,</p>\r\n<p>The Cool with it…team</p>', NULL);
