(98, 66, 'Im cool with Logo', '', '<p><img src="images/home/im_cool_with.jpg" alt="" /></p>', 1, 'rightcontent', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"_cool_with_logo","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(99, 67, 'Home Right Text', '', '<h2>100% Free, Honest Dating...With Rewards.</h2>\r\n<p>We make getting together a bit easier, more honest, and a lot more fun.</p>\r\n<p>Simply Sign in, Search, and Chat.</p>\r\n<p>See someone you''re interested in?</p>\r\n<p>Send them an Interest Token.</p>\r\n<p>When they accept, you will have the ability to view their full profile, message and chat...all for free.</p>\r\n<p>Earn Tokens only when you want to and use them to view member videos, pictures and more!</p>\r\n<p>Make sure to check out our Sponsors page for any local special Date Night offers! And use your earned tokens to redeem for free!</p>\r\n<p class="line"> </p>', 1, 'rightcontent', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"_home_right_text","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(100, 68, 'Key Features:', '', '<div class="col-xs-12">\r\n<h2>Key Features:</h2>\r\n<div class="custom col-xs-12">\r\n<div class="col-xs-4"><img src="images/home/key_features_1.jpg" alt="" /></div>\r\n<div class="col-xs-8">\r\n<ul>\r\n<li>100% free</li>\r\n<li>Free messaging</li>\r\n<li>No CC''s ever!</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="custom col-xs-12">\r\n<div class="col-xs-4"><img src="images/home/key_features_2.jpg" alt="" /></div>\r\n<div class="col-xs-8">\r\n<ul>\r\n<li>Reduce fake "likes" and wasted time</li>\r\n<li>The 1st Honesty Feedback Rating System for better dating!</li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="custom col-xs-12">\r\n<div class="col-xs-4"><img src="images/home/key_features_3.jpg" alt="" /></div>\r\n<div class="col-xs-8">\r\n<ul>\r\n<li>Rewards: Earn Tokens only when you want</li>\r\n<li>Redeem them on exclusive offers!</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>', 1, 'leftcontent', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"_key_features","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(101, 69, 'Steps', '', '', 1, 'content', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_banners', 1, 1, '{"target":"1","count":"5","cid":"0","catid":["3"],"tag_search":"0","ordering":"0","header_text":"","footer_text":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(102, 70, 'Home Steps', '', '<div class="col-lg-12 col-md-12 col-sm-12">\r\n<div class="col-lg-4 col-md-4 col-sm-4">\r\n<h3>Step 1.<br /> Sign up.  Earn Tokens every month.</h3>\r\n<p><img src="images/home/steps/step_1.jpg" alt="" /></p>\r\n<p>Members receive 10 Interest Tokens EVERY MONTH automatically!</p>\r\n<p>Includes free messaging!</p>\r\n</div>\r\n<div class="col-lg-4 col-md-4 col-sm-4">\r\n<h3>Step 2.<br /> Search.  See someone you like?</h3>\r\n<img src="images/home/steps/step_2.jpg" alt="" />\r\n<p>Send them 1 Interest Token. </p>\r\n<p>If they accept, they will contribute 1 Token, as well, and you''ll be free to chat and view each others full profiles, pictures and more!  You''ll get your Token back if they don''t!</p>\r\n</div>\r\n<div class="col-lg-4 col-md-4 col-sm-4">\r\n<h3>Step 3.<br /> Connect and Get Together!</h3>\r\n<p><img src="images/home/steps/step_3.jpg" alt="" /></p>\r\n<p>Keep a look out for exclusive offers from local restaurants and businesses who would like to sponsor a Get Together... and use your earned Tokens to redeem!  All for FREE.</p>\r\n</div>\r\n<div class="clr"> </div>\r\n<div class="empty col-lg-4 col-md-4 col-sm-4"> </div>\r\n<div class="step4 col-lg-4 col-md-4 col-sm-4"><img src="images/home/steps/step_4_1.jpg" alt="" /> <img src="images/home/steps/step_4_2.jpg" alt="" /> <img src="images/home/steps/step_4_3.jpg" alt="" />\r\n<p>So...We really are 100% free. Never worry about running out of tokens.  You get 10 Interest Tokens EVERY MONTH just for signing up! You can also earn Tokens by completing your full profile, talking to brands, uploading a video or referring a friend to name a few!  Fair enough?</p>\r\n</div>\r\n<div class="empty col-lg-4 col-md-4 col-sm-4"> </div>\r\n</div>', 1, 'content', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"_steps","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(103, 71, 'Home Facebook Login', '', '', 1, 'rightcontent', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_ulogin', 1, 1, '{"module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(104, 72, 'Home Extra Interest Tokens', '', '<p> <img src="images/home/tokens.png" alt="" /></p>\r\n<h2>Sign Up Now and Earn 20<br /> Extra Interest Tokens!</h2>', 4, 'rightcontent', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"_home_extra_interest_tokens","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(105, 73, 'Content Menu', '', '', 0, 'contentmenu', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_menu', 1, 1, '{"menutype":"mainmenu","base":"","startLevel":"1","endLevel":"0","showAllChildren":"1","tag_id":"","class_sfx":"","window_open":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"itemid","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(106, 74, 'Footer Menu login', '', '', 1, 'footer', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_menu', 1, 1, '{"menutype":"cool-footer-menu","base":"","startLevel":"1","endLevel":"0","showAllChildren":"1","tag_id":"","class_sfx":"","window_open":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"itemid","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(107, 75, 'Cool Header Menu', '', '', 1, 'mainmenu', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_menu', 1, 1, '{"menutype":"cool-header-menu","base":"","startLevel":"1","endLevel":"0","showAllChildren":"1","tag_id":"","class_sfx":"_home","window_open":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"itemid","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(108, 76, 'Bottom Content', '', '<div class="col-md-5 col-md-offset-6 col-sm-6 col-sm-offset-6 col-xs-12">\r\n<h3 class="bottom-main-title">What makes us different.</h3>\r\n<h5 class="bottom-title">We cut down on the cost of dating</h5>\r\n<p class="bottom-paragraph">We work with local venues to offer members free exclusive "Linc Up" date ideas. We''ll notify you when we have offers in your area and you can use your Tokens to redeem, at no cost to you.</p>\r\n<h5 class="bottom-title">100% free. Less wasted time</h5>\r\n<p class="bottom-paragraph">Using a Token system helps eliminate fake likes and harassing messages.</p>\r\n<h5 class="bottom-title">Honesty Feedback Rating System</h5>\r\n<p class="bottom-paragraph">We developed the first honesty feedback rating system for dating, where members earn tokens for reviewing a member they felt was honest.</p>\r\n<p class="bottom-paragraph">Personal information remains private and we think it''s a good way to reward people for being themselves, while promoting a safer online dating environment.</p>\r\n</div>', 1, 'bottom-content', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(109, 77, 'Center Content', '', '<div class="center-top-text col-sm-10 col-sm-offset-1 col-xs-12">\r\n<h1 class="center-top-title">Cool With It™ makes dating fun, honest and less expensive.</h1>\r\n<p class="center-top-paragraph">We are creating a community whose members are confident with who they are and what they are looking for, and in turn can learn and share about new places and happenings, all while getting the chance to meet other like-minded people.</p>\r\n</div>\r\n<div class="center-bottom-text col-sm-10 col-sm-offset-1 col-xs-12">\r\n<h3 class="center-bottom-title">How we work</h3>\r\n<div class="col-sm-4 col-xs-12">\r\n<div class="center-bottom-column column-member">\r\n<p class="column-title">You sign up and receive 20 Tokens every month.</p>\r\n<p class="column-text">Tokens are used to contact members. Run out of Tokens? Don’t worry, we have fun ways of getting more.</p>\r\n</div>\r\n</div>\r\n<div class="col-sm-4 col-xs-12">\r\n<div class="center-bottom-column column-token">\r\n<p class="column-title">Look around. See someone you like? Send a Token.</p>\r\n<p class="column-text">If they are <em>"Cool With"</em>  your profile, they accept by contributing a Token as well. You will then both be free to message each other.</p>\r\n</div>\r\n</div>\r\n<div class="col-sm-4 col-xs-12">\r\n<div class="center-bottom-column column-connect">\r\n<p class="column-title">Connect and Linc Up.™</p>\r\n<p class="column-text">Use your Tokens to redeem exclusive offers and enjoy!</p>\r\n</div>\r\n</div>\r\n</div>', 1, 'center-content', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
(110, 78, 'Home Logo', '', '<div style="text-align: center; position: relative;"><a style="float: left;" title="Home" href="http://iamcoolwithit.com/"><img src="images/home/home_logo.png" alt="CoolWithIt" /></a></div>', 1, 'home-logo', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 0, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static","module_tag":"div","bootstrap_size":"0","header_tag":"h3","header_class":"","style":"0"}', 0, '*'),
